INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "青空の下で謁見", 40, 10118, 91002, "ペコリーヌとの出会い", 5118061, "フリーマーケット会場", 0, 1, 7, 2834, 8, 2, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "未来の騎空団\nマスコット？", 40, 10118, 91002, "マホとの出会い", 5118062, "フリーマーケット会場", 0, 1, 7, 2835, 8, 2, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "お嬢さまからの\n緊急依頼", 40, 10118, 91002, "アキノとの出会い", 5118063, "ランドソル市街地", 0, 1, 7, 2837, 8, 2, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "黄金色の悩みごと", 40, 10118, 91002, "ジュンとの出会い", 5118064, "フリーマーケット会場", 0, 1, 18, 4108402, 8, 2, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "白熱！　格闘大会！", 40, 10118, 91002, "カオリとの出会い", 5118065, "フリーマーケット会場", 0, 1, 18, 4107402, 8, 2, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "祭り太鼓はオーエドの華", 40, 10118, 91002, "ニノンとの出会い", 5118066, "オーエド町", 1, 1, 16, 9000227, 8, 2, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "人気者は遅れて\nやってくる", 40, 10118, 91002, "スズナとの出会い", 5118067, "フリーマーケット会場", 0, 1, 19, 2101181, 8, 3, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "巫女・ミーツ・魔法少女", 40, 10118, 91002, "ナナカとの出会い", 5118068, "ランドソル市街地", 0, 1, 18, 4109402, 8, 3, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "ネズ耳は二度なくなる", 40, 10118, 91002, "キャル＆コッコロとの出会い", 5118069, "フリーマーケット会場", 0, 1, 18, 4305402, 8, 3, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "この出会いにカンパイ！", 40, 10118, 91002, "ユカリとの出会い", 5118070, "ランドソル市街地", 0, 1, 18, 4101402, 8, 3, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "陰陽アンサンブル", 40, 10118, 91002, "アオイとの出会い", 5118071, "ランドソル市街地", 0, 1, 18, 4106402, 8, 3, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "運試し十番勝負！", 40, 10118, 91002, "シノブとの出会い", 5118072, "フリーマーケット会場", 1, 1, 7, 2836, 8, 3, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (20063115, "彼女たちの新たな日常", 0, 10118, 0, "オープニング", 5118600, 0, 0, 0, 0, 0, 0, 1, 0);
